import axios from 'axios'
import { postWithoutTokenFunciton,getFunciton,deleteFunciton } from 'utils/ApiHelper'
import {OrderForm, OrderFormManual, OrderModel, OrderPost,} from '../models/Order'



export async function getListOrder(user:string) {
  const res:any = await getFunciton("videobuffh/getorderbuffh?user="+user)
  return res
}

export async function getOrderFilter(key:string,user:string) {
  const res:any = await getFunciton("videobuffh/getorderfilterbuffh?key="+key+'&user='+user)
  return res
}

export async function getOrderPercentFilter(key:number) {
  const res:any = await getFunciton("videobuffh/getorderbypercentbuffh?key="+key)
  return res
}
export async function addorderv2( videoid:string,
                                  homerate:number,
                                  note:string,
                                  directrate:number,
                                  commentrate:number,
                                  mobilerate:number,
                                  searchrate:number,
                                  enabled:number,
                                  maxthreads:number,
                                  viewstart:number,
                                  likerate:number,
                                  suggestrate:number,
                                  timebuff:number,
                                  optionbuff:number,
                                  user:string) {
  const res = await postWithoutTokenFunciton("videobuffh/orderbuffh", {
    videoid:videoid,
    homerate:homerate,
    note:note,
    directrate:directrate,
    commentrate:commentrate,
    mobilerate:mobilerate,
    searchrate:searchrate,
    enabled:enabled,
    maxthreads:maxthreads,
    viewstart:viewstart,
    likerate:likerate,
    suggestrate:suggestrate,
    timebuff:timebuff,
    optionbuff:optionbuff,
    user:user
  })
  return res
}

export async function deleteHistoryError() {
  const res:any = await getFunciton("api/deleteHistoryError")
  return res
}



export async function getSetting() {
  const res:any = await getFunciton("api/setting")
  return res
}
export async function getListGroups() {
  const res:any = await getFunciton("/group/list")
  return res
}


export async function updateSetting(channel_prior:number) {
  console.log("api/updateSetting?channel_prior="+channel_prior)
  const res:any = await getFunciton("api/updateSetting?channel_prior="+channel_prior)
  return res
}

export async function updateOrder(order:OrderModel) {
  const res:any = await postWithoutTokenFunciton("videobuffh/update",order)
  return res
}


export async function addOrder(order:OrderForm) {
  const res:any = await postWithoutTokenFunciton("",order)
  return res
}
export async function addOrderManual(order:OrderFormManual) {
  const res:any = await postWithoutTokenFunciton("videobuffh/orderbuffh",order)
  return res
}

export async function addOrderMulti(order:OrderPost) {
  const res:any = await postWithoutTokenFunciton("",order)
  return res
}




export async function addGroup(groupName:string) {
  const res:any = await postWithoutTokenFunciton("/group/insert",{
    name: groupName
  })
  return res
}

export async function deleteGroup(id:number) {
  const res:any = await deleteFunciton("/group/delete?id="+id)
  return res
}

export async function deleteChannel(videoid:string,cancel:number) {
  const res:any = await deleteFunciton("/videobuffh/delete?videoid="+videoid+'&cancel='+cancel)
  return res
}
